        return 0
    dp = [[[0 for _ in range(2)] for _ in range(K + 1)] for _ in range(N)]
    for i in range(N):
        dp[i][0][0] = 0
    for k in range(K + 1):
        dp[0][k][0] = 0
        dp[0][k][1] = -A[0]
    for i in range(1, N):
        for k in range(1, K + 1):
            dp[i][k][0] = max(dp[i - 1][k][0], dp[i - 1][k][1] + A[i])
            dp[i][k][1] = max(dp[i - 1][k][1], dp[i - 1][k - 1][0] - A[i])
    return dp[N - 1][K][0]

